import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Logo from './components/Logo';
import './App.css';

const App = () => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [showScrollTop, setShowScrollTop] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
      setShowScrollTop(window.scrollY > 300);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <Router>
      <div className="app">
        <header className={`header ${isScrolled ? 'scrolled' : ''}`}>
          <div className="header-content">
            <Link to="/" className="logo-link">
              <Logo />
            </Link>
            <nav className="nav-menu">
              <Link to="/" className="nav-link">Home</Link>
              <Link to="/about" className="nav-link">About</Link>
              <Link to="/events" className="nav-link">Events</Link>
              <Link to="/gallery" className="nav-link">Gallery</Link>
              <Link to="/contact" className="nav-link">Contact</Link>
              <Link to="/admin" className="nav-link admin-link">Admin</Link>
            </nav>
          </div>
        </header>

        <main>
          <section className="hero">
            <div className="hero-content">
              <h1 className="hero-title">Welcome to Edo Cultural Association Italy</h1>
              <p className="hero-subtitle">Preserving and promoting Edo culture in Italy</p>
              <Link to="/about" className="cta-button">Learn More</Link>
            </div>
          </section>

          <section className="section">
            <h2 className="section-title">Upcoming Events</h2>
            <div className="card-grid">
              {/* Event cards will be dynamically added here */}
            </div>
          </section>

          <section className="section">
            <h2 className="section-title">Latest News</h2>
            <div className="card-grid">
              {/* News cards will be dynamically added here */}
            </div>
          </section>

          <section className="section">
            <h2 className="section-title">Photo Gallery</h2>
            <div className="card-grid">
              {/* Gallery items will be dynamically added here */}
            </div>
          </section>
        </main>

        <footer className="footer">
          <div className="footer-content">
            <div className="footer-section">
              <h3>Contact Us</h3>
              <p>Email: info@edocultural.it</p>
              <p>Phone: +39 XXX XXX XXXX</p>
              <p>Address: Via Example, 123, City, Italy</p>
            </div>
            <div className="footer-section">
              <h3>Quick Links</h3>
              <p>About Us</p>
              <p>Events</p>
              <p>Gallery</p>
              <p>Contact</p>
            </div>
            <div className="footer-section">
              <h3>Follow Us</h3>
              <div className="social-links">
                <a href="#" className="social-link">Facebook</a>
                <a href="#" className="social-link">Instagram</a>
                <a href="#" className="social-link">Twitter</a>
              </div>
            </div>
          </div>
        </footer>

        <button 
          className={`scroll-top ${showScrollTop ? 'visible' : ''}`}
          onClick={scrollToTop}
        >
          â†‘
        </button>
      </div>
    </Router>
  );
};

export default App;
